export default function Home(){
    return(
        <div className="header">
            <img className= "image" src="/lucifer.jpg" alt="lucifer"/>
            <div className='text'>
                Home
            </div>
            <div className="logo">
                <img src="/logo.jpg" alt="" />
            </div>
        </div>
    )
}
